SET GLOBAL max_allowed_packet=64*1024*1024;
DROP TABLE IF EXISTS `hints`;
CREATE TABLE `hints` (`id` INT(10) NULL DEFAULT NULL,`hint` TEXT NULL);
INSERT INTO `hints` (`id`, `hint`) VALUES	(1, 'После варки риса для суши рис кладётся в деревянную кадку и заправляется уксксной смесью. Перемешивать рис надо плоской деревянной лопаткой, не приминая.'),
	(2, 'Онигири делаются из риса не заправленного уксусом. Начинка для онигири может быть любой - тунец, лосось, солёная слива, натто и даже маринованные огурцы.'),
	(3, 'Раньше натто готовили, пропаривая специальные натто-бобы и помещая в рисовую солому. Их клали в тёплое место в доме, например, в котацу. В это время содержащаяся в рисовой соломе сенная палочка размножалась, превращая бобы в натто.'),
	(4, 'Мисо производится путем ферментизации соевых бобов или злаков с помощью плесневых грибов. Представляет собой густую пасту. Мисо очень полезно - содержит цинк, железо, витамины A и D.'),
	(5, 'Исследования показали, что в васаби содержатся вещества, которые подавляют рост бактерий, вызывающих кариес. Чрезвычайную популярность приправы в сочетании с сырой рыбой можно объяснить сильными антимикробными свойствами васаби.'),
	(6, 'Окономияки - это жаренные лепешки из  муки, яиц, капусты и стружки тунца. Окономияки может содержать другие ингридиенты - сыр, мясо, овощи. Это блюдо иногда называют японской пиццей.'),
	(7, 'Рамен считается блюдом японской, китайской и корейской кухни. При его приготовлении сначала варится бульон, затем пшеничная лапша, после в пиалу выкладывается отваренная лапша и заливается бульоном. Сверху на лапшу выкладываются остальные компоненты.'),
	(8, 'Из фасоли адзуки готовится паста, которую используют при приготовлении десертов и сладкого супа. Он готовится из уваренных с сахаром и щепоткой соли адзуки и называется сируко.'),
	(9, 'Корень лотоса используется в японской, китайской и тайской кухнях и считается деликатесом. При неправильном приготовлении и несвоевременном сборе корень лотоса может быть ядовит.'),
	(10, 'Исследователи из Университета Хоккайдо обнаружили в водорослях вакаме вещество фукоксантин, который способствует сжиганию жира. Вакаме также применяются в косметических процедурах.');

DROP TABLE IF EXISTS `users`;
CREATE TABLE `users` (
`id` BIGINT(20) NOT NULL AUTO_INCREMENT,
`email` VARCHAR(255) NOT NULL,
`first_name` VARCHAR(255) NOT NULL,
`last_name` VARCHAR(255) NULL DEFAULT NULL,
`pwd` VARCHAR(255) NOT NULL,
`photo` LONGBLOB NULL,
`sex` VARCHAR(255) NOT NULL,
PRIMARY KEY (`id`),
UNIQUE INDEX `email` (`email`));

DROP TABLE IF EXISTS `category`;
CREATE TABLE `category` (
`id` BIGINT(20) NOT NULL AUTO_INCREMENT,
`info` VARCHAR(255) NOT NULL,
PRIMARY KEY (`id`));

DROP TABLE IF EXISTS `recipe`;
CREATE TABLE `recipe` (
`id` BIGINT(20) NOT NULL AUTO_INCREMENT,
`category` VARCHAR(255) NOT NULL,
`xml` LONGTEXT NULL,
PRIMARY KEY (`id`));
INSERT INTO `recipe` (`id`, `category`, `xml`) VALUES	(1, 'другое', '<?xml version="1.0" encoding="UTF-8"?><root><name>Японский омлет たまご</name>  <info>Слоёный омлет</info>  <prepare>    <ingredient amount="3" unit="шт.">яйцо</ingredient>    <ingredient amount="1" unit="ч. л.">соль</ingredient>    <ingredient amount="1" unit="ч. л.">сахар</ingredient>    <ingredient amount="2" unit="ч. л.">бульон даси </ingredient>    <ingredient amount="2" unit="ч. л.">соевый соус </ingredient>  </prepare>  <cook>    <step>Все ингредиенты смешать</step>    <step>На горячую сковороду вылить половину смеси. Когда омлет "возьмется" свернуть в рулет и прижать</step>    <step>Вылить оставшуюся часть и проделать предыдущий шаг.</step>  </cook>  <image></image></root>');
INSERT INTO `recipe` (`id`, `category`, `xml`) VALUES	(2, 'суши', '<?xml version="1.0" encoding="UTF-8"?>\r\n<root>\r\n  <name>Суши с тунцом　まぐろすし</name>\r\n  <info>Традиционное блюдо</info>\r\n  <prepare>\r\n    <ingredient amount="200" unit="грамм">Рис для суши</ingredient>\r\n    <ingredient amount="100" unit="грамм">Тунец</ingredient>\r\n    <ingredient amount="2" unit="ч. л.">Уксус для суши </ingredient>\r\n    <ingredient amount="1" unit="ч. л.">васаби</ingredient>\r\n  </prepare>\r\n  <cook>\r\n    <step>Сварить рис из расчета на 1 часть риса 1,5 воды. Остудить, заправить уксусом</step>\r\n    <step>Филе тунца тонко нарезать прямоугольными ломтиками</step>\r\n    <step>Из риса слепить прямоугольные брусочки 2*4 см</step>\r\n    <step>Рис намазать васаби, положить тунца, прижать</step>\r\n  </cook>\r\n  <image></image>\r\n</root>\r\n'),
	(3, 'супы', '<?xml version="1.0" encoding="UTF-8"?>\r\n<root>\r\n  <name>Мисо-суп с тофу　豆腐の味噌汁</name>\r\n  <info>Суп по классическому рецепту. На 4 порции</info>\r\n  <prepare>\r\n    <ingredient amount="2" unit="ст. л.">Паста мисо</ingredient>\r\n    <ingredient amount="200" unit="грамм">Тофу</ingredient>\r\n    <ingredient amount="1" unit="ст. л.">Даси (бульон в виде порошка)</ingredient>\r\n    <ingredient amount="1" unit="шт.">Лук-порей или зеленый лук</ingredient>\r\n    <ingredient amount="2" unit="ст. л.">Вакаме</ingredient>\r\n  </prepare>\r\n  <cook>\r\n    <step>Пасту разводим в теплой кипяченой воде до растворения.</step>\r\n    <step>Тофу нарезаем кубиками средней величины. Вакаме промываем и оставляем для набухания.</step>\r\n    <step>Даси доводим до кипения и вливаем мисо.</step>\r\n    <step>Бросаем в суп тофу и водоросли.</step>\r\n    <step>Посыпать нарезаным луком.</step>\r\n  </cook>\r\n  <image></image>\r\n</root>\r\n'),
	(4, 'десерты', '<?xml version="1.0" encoding="UTF-8"?>\r\n<root>\r\n  <name>Дайфуку с клубникой イチゴ大福</name>\r\n  <info>Нежный десерт с клубникой</info>\r\n  <prepare>\r\n    <ingredient amount="100" unit="грамм">Широтама-ко - рисовая мука из двух сортов риса</ingredient>\r\n    <ingredient amount="200" unit="грамм">Паста цубуан из бобов адзуки</ingredient>\r\n    <ingredient amount="10" unit="шт.">Клубника</ingredient>\r\n    <ingredient amount="200" unit="грамм">Холодная вода</ingredient>\r\n    <ingredient amount="120" unit="грамм">Сахар </ingredient>\r\n    <ingredient amount="2" unit="ст. л.">Крахмал </ingredient>\r\n  </prepare>\r\n  <cook>\r\n    <step>Клубнику завернуть в бобовую пасту и скатать в шарики.</step>\r\n    <step>В посуду насыпать рисовую муку и сахар, добавить воду, размешать,накрыть пленкой и поставить в микроволновку на 2 минуты. Доставать из микроволновки, перемешивать и накрывать пленкой несколько раз.</step>\r\n    <step>Разделочную доску посыпать крахмалом и вывалить на него полученное тесто.</step>\r\n    <step>Каждый кусок сформировать в плоскую круглую лепешку, завернуть начинку. </step>\r\n  </cook>\r\n  <image></image>\r\n</root>\r\n'),
	(5, 'суши', '<?xml version="1.0" encoding="UTF-8"?>\r\n<root>\r\n  <name>Роллы с лососем и авокадо　アボカド と鮭巻き寿司</name>\r\n  <info>Изысканный вкус</info>\r\n  <prepare>\r\n    <ingredient amount="100" unit="грамм">рис</ingredient>\r\n    <ingredient amount="100" unit="грамм">лосось</ingredient>\r\n    <ingredient amount="1" unit="шт.">авокадо</ingredient>\r\n    <ingredient amount="1" unit="ст. л.">уксус для суши</ingredient>\r\n    <ingredient amount="1" unit="ч. л.">васаби</ingredient>\r\n    <ingredient amount="1" unit="шт.">нори</ingredient>\r\n  </prepare>\r\n  <cook>\r\n    <step>Сварить рис из расчета на 1 часть риса 1,5 воды. Остудить, заправить уксусом</step>\r\n    <step>Филе лосося нарезаем полосками</step>\r\n    <step>Нарезаем авокадо</step>\r\n    <step>Кладём водоросль к краю циновки гладкой стороной вниз и смачиваем нори водой. Распределяем влажными руками рис тонким слоем на нори так, чтобы от бока водоросли отставалось свободно примерно 1 см.</step>\r\n    <step>Начинку смазываем небольшим количеством васаби. Прижимаем начинку и с помощью циновки сворачиваем нори.</step>\r\n    <step>Влажным острым ножом разрезаем на 6 частей.</step>\r\n  </cook>\r\n  <image></image>\r\n</root>\r\n'),
	(6, 'другое', '<?xml version="1.0" encoding="UTF-8"?>\r\n<root>\r\n  <name>Онигири おにぎり</name>\r\n  <info>Онигири готовят из обычного риса, не добавляя уксус.</info>\r\n  <prepare>\r\n    <ingredient amount="200" unit="грамм">рис</ingredient>\r\n    <ingredient amount="100" unit="грамм">лосось, тунец или солёные сливы</ingredient>\r\n    <ingredient amount="1" unit="шт.">лист нори</ingredient>\r\n  </prepare>\r\n  <cook>\r\n    <step>Сварить рис из расчета на 1 часть риса 1,5 воды. </step>\r\n    <step>Взять небольшое количество вареного риса, в середину положить начинку</step>\r\n    <step>Начинку завернуть рисом и сформировать треугольники</step>\r\n    <step>Кусочками водоросли обернуть онигири</step>\r\n    <step>По желанию посыпать кунжутом</step>\r\n  </cook>\r\n  <image></image>\r\n</root>\r\n'),
	(7, 'другое', '<?xml version="1.0" encoding="UTF-8"?>\r\n<root>\r\n  <name>темпура из креветок えびてんぷら</name>\r\n  <info>На 4 порции</info>\r\n  <prepare>\r\n    <ingredient amount="12" unit="шт.">большие креветки</ingredient>\r\n    <ingredient amount="150" unit="грамм">мука</ingredient>\r\n    <ingredient amount="200" unit="грамм">ледяная вода</ingredient>\r\n    <ingredient amount="1" unit="шт.">яйцо</ingredient>\r\n    <ingredient amount="1" unit="ч. л.">соль</ingredient>\r\n  </prepare>\r\n  <cook>\r\n    <step>Очистить креветки, оставив хвосты. Надрезать креветки вдоль, затем сделать небольшой надрез поперек.</step>\r\n    <step>Для кляра слегка взбить яйцо, добавить воду, соль, муку для темпуры и крахмал, размешать, оставив комочки.</step>\r\n    <step>Разогреть масло для фритюра, положить креветки в кляр и обжарить 1-2 минуты с каждой стороны.</step>\r\n    <step>Удалить лишний жир и подавать с соевым соусом</step>\r\n  </cook>\r\n  <image></image>\r\n</root>\r\n'),
	(8, 'лапша', '<?xml version="1.0" encoding="UTF-8"?>\r\n<root>\r\n  <name>Какэсоба かけそば</name>\r\n  <info>На 4 порции</info>\r\n  <prepare>\r\n    <ingredient amount="200" unit="грамм">гречневая мука</ingredient>\r\n    <ingredient amount="50" unit="грамм">пшеничная мука</ingredient>\r\n    <ingredient amount="150" unit="грамм">вода</ingredient>\r\n    <ingredient amount="2" unit="ст. л.">даси</ingredient>\r\n    <ingredient amount="2" unit="ст. л.">соевый соус</ingredient>\r\n    <ingredient amount="2" unit="ст. л.">мирин</ingredient>\r\n    <ingredient amount="1" unit="шт.">зелёный лук</ingredient>\r\n  </prepare>\r\n  <cook>\r\n    <step>Раскатать тесто и разрезать на полоски</step>\r\n    <step>Бросить лапшу в кипящую воду</step>\r\n    <step>Сварить бульон</step>\r\n    <step>При подаче украсить зелёным луком</step>\r\n  </cook>\r\n  <image></image>\r\n</root>\r\n');
INSERT INTO `recipe` (`id`, `category`, `xml`) VALUES	(9, 'суши', '<?xml version="1.0" encoding="UTF-8"?>\r\n<root>\r\n  <name>Роллы с лососем</name>\r\n  <info>Одно из самых популярных блюд</info>\r\n  <prepare>\r\n    <ingredient amount="200" unit="грамм">рис для суши</ingredient>\r\n    <ingredient amount="100" unit="грамм">лосось</ingredient>\r\n    <ingredient amount="1" unit="шт.">лист водоросли нори </ingredient>\r\n    <ingredient amount="1" unit="ст. л.">рисовый уксус </ingredient>\r\n    <ingredient amount="1" unit="ч. л.">васаби</ingredient>\r\n  </prepare>\r\n  <cook>\r\n    <step>Сварить рис из расчета на 1 часть риса 1,5 воды. Остудить, заправить уксусом</step>\r\n    <step>Филе лосося нарезаем полосками</step>\r\n    <step>Кладём водоросль к краю циновки гладкой стороной вниз и смачиваем нори водой. Распределяем влажными руками рис тонким слоем на нори так, чтобы от бока водоросли оставалось свободно примерно 1 см.</step>\r\n    <step>Начинку смазываем небольшим количеством васаби. Прижимаем и с помощью циновки сворачиваем нори.&#13;\r\n</step>\r\n    <step>Влажным острым ножом разрезаем на 6 частей.</step>\r\n  </cook>\r\n  <image></image>\r\n</root>\r\n'),
	(15, 'лапша', '<?xml version="1.0" encoding="UTF-8"?>\r\n<root>\r\n  <name>Удон うどん</name>\r\n  <info>Блюдо из пшеничной лапши. Ее подают, как самостоятельное блюдо, как гарнир, а также часто используют в супах</info>\r\n  <prepare>\r\n    <ingredient amount="200" unit="грамм">Лапша удон</ingredient>\r\n    <ingredient amount="1" unit="ст. л.">Водоросли вакаме </ingredient>\r\n    <ingredient amount="3" unit="ст. л.">Даси</ingredient>\r\n    <ingredient amount="1" unit="шт.">Яйцо</ingredient>\r\n    <ingredient amount="1" unit="шт.">Зеленый лук</ingredient>\r\n    <ingredient amount="2" unit="ч. л.">сахар</ingredient>\r\n    <ingredient amount="2" unit="ст. л.">соевого соуса</ingredient>\r\n  </prepare>\r\n  <cook>\r\n    <step>Положите в кипящую воду даси, размешайте, уменьшите огонь и оставьте вариться на 5-7 минут.</step>\r\n    <step>В кипящий бульон добавьте соевого соуса и сахара</step>\r\n    <step>Удон бросьте в кипящую воду и проварите в течение 5-8 минут на среднем огне. После того, как лапша свариться откиньте ее на дуршлаг, процедите и промойте холодной водой.</step>\r\n    <step>Добавьте сваренный удон в бульон и проварите в течение 3-5 минут.</step>\r\n    <step>Возьмите вакаме, залейте их кипятком и дайте настояться в течение 15 мин.&#13;\r\nВыньте разбухшие водоросли и положите их в каждую тарелку.&#13;\r\nУкрасьте яйцом и мелко нарезанным зеленым луком.</step>\r\n  </cook>\r\n  <image></image>\r\n</root>\r\n'),
	(16, 'суши', '<?xml version="1.0" encoding="UTF-8"?>\r\n<root>\r\n  <name>Суши с креветкой えびのお寿司</name>\r\n  <info>Для приготовления надо брать неочищенные большие креветки</info>\r\n  <prepare>\r\n    <ingredient amount="100" unit="грамм">рис для суши</ingredient>\r\n    <ingredient amount="1" unit="ст. л.">рисовый уксус</ingredient>\r\n    <ingredient amount="4" unit="шт.">креветки</ingredient>\r\n  </prepare>\r\n  <cook>\r\n    <step>Сварить рис, заправить уксусом</step>\r\n    <step>Креветки наколоть на бамбуковые шпажки и варить примерно 5 мин.</step>\r\n    <step>У креветок удалить головы и панцирь, разрезать вдоль брюшка, разровнять</step>\r\n    <step>Из риса сделать брусочки примерно 2*4см.</step>\r\n    <step>Положить креветку, прижать</step>\r\n  </cook>\r\n  <image></image>\r\n</root>\r\n'),
	(17, 'десерты', '<?xml version="1.0" encoding="UTF-8"?>\r\n<root>\r\n  <name>Митараси данго みたらし団子</name>\r\n  <info>Подаются с соусом</info>\r\n  <prepare>\r\n    <ingredient amount="100" unit="грамм">Рисовая мука</ingredient>\r\n    <ingredient amount="20" unit="грамм">сахар</ingredient>\r\n    <ingredient amount="50" unit="грамм">тёплая вода</ingredient>\r\n    <ingredient amount="1" unit="ст. л.">крахмал</ingredient>\r\n    <ingredient amount="1" unit="ст. л.">соевого соуса</ingredient>\r\n  </prepare>\r\n  <cook>\r\n    <step>Из муки, воды и сахара сделать шарики и варим в кипящей воде. После варки окунаем в холодную воду</step>\r\n    <step>Из соевого соуса, крахмала воды и сахара делаем соус и увариваем до загустения</step>\r\n    <step>На деревянные шпажки нанизываем данго и окунаем их в соус</step>\r\n  </cook>\r\n  <image></image>\r\n</root>\r\n');

DROP TABLE IF EXISTS `category_recipe`;
CREATE TABLE `category_recipe` (
`category_id` BIGINT(20) NOT NULL,
`recipe_id` BIGINT(20) NOT NULL,
PRIMARY KEY (`category_id`, `recipe_id`),
INDEX `recipe_id` (`recipe_id`),
FOREIGN KEY (`category_id`) REFERENCES `category` (`id`),
FOREIGN KEY (`recipe_id`) REFERENCES `recipe` (`id`));

DROP TABLE IF EXISTS `user_recipe`;
CREATE TABLE `user_recipe` (
`user_id` BIGINT(20) NOT NULL,
`recipe_id` BIGINT(20) NOT NULL,
PRIMARY KEY (`user_id`, `recipe_id`),
UNIQUE INDEX `recipe_id` (`recipe_id`),
FOREIGN KEY (`user_id`) REFERENCES `users` (`id`),
FOREIGN KEY (`recipe_id`) REFERENCES `recipe` (`id`));
